{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/andresoghomonians/investigating-the-2022-summer-transfer-window?scriptVersionId=136054872\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"4081b6d2","metadata":{"papermill":{"duration":0.011574,"end_time":"2023-07-07T21:05:08.14727","exception":false,"start_time":"2023-07-07T21:05:08.135696","status":"completed"},"tags":[]},"source":["# Investigating The 2022 Summer Transfer Window\n","By: Andre Soghomonians"]},{"cell_type":"markdown","id":"5ffa2006","metadata":{"papermill":{"duration":0.010328,"end_time":"2023-07-07T21:05:08.167591","exception":false,"start_time":"2023-07-07T21:05:08.157263","status":"completed"},"tags":[]},"source":["## **Table of Contents**\n","\n","### 1. [Introduction](#introduction)\n","### 2. [The Data](#data)\n","### 3. [Data Cleaning](#data_cleaning)\n","### 4. [Data Visualization](#data_viz)\n","### 5. [Further Investigation](#further_inv)\n","### 6. [Appendix](#appendix)"]},{"cell_type":"markdown","id":"24ccf5be","metadata":{"papermill":{"duration":0.009854,"end_time":"2023-07-07T21:05:08.187307","exception":false,"start_time":"2023-07-07T21:05:08.177453","status":"completed"},"tags":[]},"source":["## **Introduction** <a id=\"introduction\"></a>\n","\n","Every year, thousands of professional football players transfer to different clubs worldwide. In this small project, I investigated whether there are any trends with regard to age among football leagues. I first looked at each individual country that had data available from the previous 2022 summer transfer window. Afterward, I grouped the countries by FIFA association for a more generalized view of the dataset. "]},{"cell_type":"markdown","id":"f173d2a2","metadata":{"papermill":{"duration":0.010122,"end_time":"2023-07-07T21:05:08.20741","exception":false,"start_time":"2023-07-07T21:05:08.197288","status":"completed"},"tags":[]},"source":["## **The Data** <a id=\"data\"></a>\n","\n","The primary dataset used is titled [\"Football Transfer window from July to September\"](https://www.kaggle.com/datasets/mohamedsiika/football-transfer-window-from-july-to-september) by Mohamed Sayed which can be found in the data tab of this notebook. I manually inserted each nation's FIFA association myself by creating an excel file and joining the datasets together. I got the information for the excel file [here](https://www.fifa.com/about-fifa/associations) \n","\n","Note: Monaco is not officially a member of any association recognized by FIFA, so they were grouped with UEFA due to geographical location and the fact AS Monaco are members of Ligue 1 of France. "]},{"cell_type":"markdown","id":"f4644471","metadata":{"papermill":{"duration":0.009811,"end_time":"2023-07-07T21:05:08.227047","exception":false,"start_time":"2023-07-07T21:05:08.217236","status":"completed"},"tags":[]},"source":["## **Data Cleaning** <a id=\"data_cleaning\"></a>"]},{"cell_type":"code","execution_count":1,"id":"eeaa1bb9","metadata":{"execution":{"iopub.execute_input":"2023-07-07T21:05:08.2509Z","iopub.status.busy":"2023-07-07T21:05:08.248579Z","iopub.status.idle":"2023-07-07T21:05:09.885221Z","shell.execute_reply":"2023-07-07T21:05:09.883238Z"},"papermill":{"duration":1.65189,"end_time":"2023-07-07T21:05:09.888736","exception":false,"start_time":"2023-07-07T21:05:08.236846","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.2 ──\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.4.0      \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.5 \n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.8      \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.10\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.1      \u001b