3582Z"},"papermill":{"duration":0.11763,"end_time":"2023-07-07T21:05:10.608949","exception":false,"start_time":"2023-07-07T21:05:10.491319","status":"completed"},"tags":[]},"outputs":[],"source":["# Tidying up the original dataframe and filtering out incomplete data\n","summer_transfers <- summer_transfers %>%  \n","  select(-\"Unnamed: 0\") %>% #Removing duplicate column\n","  rename(id = \"...1\") %>% #Naming unnamed column\n","  filter(to_country != \"unknown_country\", from_country != \"unknown_country\",\n","         to_club != \"unkown_club\", from_club != \"unknown_club\",\n","         to_league != \"unknown_league\", from_league != \"unknown_league\") #Removing values where transfer info is unknown"]},{"cell_type":"code","execution_count":4,"id":"7221de3f","metadata":{"execution":{"iopub.execute_input":"2023-07-07T21:05:10.63476Z","iopub.status.busy":"2023-07-07T21:05:10.632807Z","iopub.status.idle":"2023-07-07T21:05:10.734403Z","shell.execute_reply":"2023-07-07T21:05:10.731704Z"},"papermill":{"duration":0.11786,"end_time":"2023-07-07T21:05:10.73772","exception":false,"start_time":"2023-07-07T21:05:10.61986","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>country</th><th scope=col>avg_dep</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>Malaysia   </td><td>30.33333</td></tr>\n","\t<tr><td>Lebanon    </td><td>30.23810</td></tr>\n","\t<tr><td>Honduras   </td><td>28.86486</td></tr>\n","\t<tr><td>Qatar      </td><td>28.67742</td></tr>\n","\t<tr><td>El Salvador</td><td>28.22034</td></tr>\n","\t<tr><td>Bolivia    </td><td>27.93750</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A tibble: 6 × 2\n","\\begin{tabular}{ll}\n"," country & avg\\_dep\\\\\n"," <chr> & <dbl>\\\\\n","\\hline\n","\t Malaysia    & 30.33333\\\\\n","\t Lebanon     & 30.23810\\\\\n","\t Honduras