":["All regions seem to follow a similar trend, however there are differences in how sharp the slope is. The variation differs by region as well. AFC has the most variation compared to the others, which are fitted closely to their lines of best fit. CONMEBOL would follow this trend as well, if not for Bolivia being such a big outlier."]},{"cell_type":"markdown","id":"0ec33965","metadata":{"papermill":{"duration":0.015041,"end_time":"2023-07-07T21:05:14.232227","exception":false,"start_time":"2023-07-07T21:05:14.217186","status":"completed"},"tags":[]},"source":[]},{"cell_type":"markdown","id":"b88e9d1d","metadata":{"papermill":{"duration":0.014903,"end_time":"2023-07-07T21:05:14.262427","exception":false,"start_time":"2023-07-07T21:05:14.247524","status":"completed"},"tags":[]},"source":["## **Further Investigation** <a id=\"further_inv\"></a>\n","\n","Although this specific dataset was too small to confidently draw any conclusions, I would like to see if any of these trends hold up historically. If such trends exist, investigating what causes them could be another project. In particular, it would be interesting to see how finances play a role. Poorer leagues may not have the funds to retain rising starts and be forced to sell them to leagues with teams that can afford them. Additionally, I would like to compare the differences between different tiers of leagues. While this is likely highly correlated to finances, there may be differences depending on the country and their football infrastructure. "]},{"cell_type":"markdown","id":"e10628bd","metadata":{"papermill":{"duration":0.014832,"end_time":"2023-07-07T21:05:14.292251","exception":false,"start_time":"2023-07-07T21:05:14.277419","status":"completed"},"tags":[]},"source":["## **Appendix** <a id=\"appendix\"></a>\n","\n","### Appendix 1: Average age of departing players, incoming players, and difference for all countries "]},{"cell_type":"code","execution_count":10,"id":"41280e2b","metadata":{"execution":{"iopub.e